import { useRouter } from 'next/router'
import axios from 'axios'

const Pokemon = () => {
    const router = useRouter()
    const name = router.query.name

    axios.get(`https://pokeapi.co/api/v2/pokemon/${name}`)
        .then(res =>  {
            console.log(res)
        })


    return (
        <h1>POKEMON: { name }</h1>
    )
}

export default Pokemon
